// src/App.js
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import SignUpForm from './SignUpForm';
import './App.css';

const App = () => (
  <BrowserRouter>
    <Routes>
      <Route path="/signup" element={<SignUpForm />} />
      <Route path="/login" element={<Login/>} />
    </Routes>
  </BrowserRouter>
);

export default App;
